import { makeAutoObservable } from "mobx";


function Store() {
    const store = makeAutoObservable({
        allEmployee: [
    {
        "employeeId": 1,
        "fullName": "shivam",
        "gender": "Male",
        "dateOfBirth": "2001-01-06T18:30:00.000Z",
        "state": "Andhra Pradesh",
        "active": true,
        "profileImagePreview": "data:image/jpeg;base64,"
    },
     {  
        "employeeId": 2,
        "fullName": "anuj",
        "gender": "Male",
        "dateOfBirth": "2000-05-04T18:30:00.000Z",
        "state": "Andhra Pradesh",
        "active": true,
        "profileImagePreview": "data:image/jpeg;base64,"
    },
     {
        "employeeId": 3,
        "fullName": "deeksha",
        "gender": "Female",
        "dateOfBirth": "2009-10-14T18:30:00.000Z",
        "state": "Andhra Pradesh",
        "active": false,
        "profileImagePreview": "data:image/jpeg;base64,"
    }
],
        addEmployee (employee)  {
            const updatedEmployee = {...employee, ["employeeId"]: store.allEmployee[store.allEmployee.length - 1].employeeId + 1}; 
            store.allEmployee.push(updatedEmployee);
        },

        editEmployee(employee){
            const index = store.allEmployee.findIndex(emp => emp.employeeId === employee.employeeId);
            if (index !== -1) {
                store.allEmployee[index] = employee;
            }
        },

        deleteEmployee(employeeId) {
            store.allEmployee = store.allEmployee.filter(emp => emp.employeeId !== employeeId);
        },
        
        getTotalEmployees() {
            return store.allEmployee;
        },
        getActiveEmployees() {
            return store.allEmployee.filter(emp => emp.active === true).length;
        },
         getInactiveEmployees() {
            return store.allEmployee.filter(emp => emp.active === false).length;
        }
    });
    return store;
}

export  default Store;
